var colors = ["#8dd3c7", "#ffffb3", "#bebada", "#fb8072", "#80b1d3", "#fdb462", "#b3de69", "#fccde5", "#d9d9d9", "#bc80bd", "#ccebc5", "#ffed6f"];

// the style for municipalities, they are colored by the first two digits (the canton-id)
var municipalityStyle = function (feature) {
  return { 
      weight: 1, 
      opacity: 1, 
      color: 'black', 
      dashArray: '', 
      fillOpacity: 0.25,
      fillColor: colors[feature.properties.id.substring(0, 4) % colors.length]
  };
};
// Additional POIs
var pois = [
  { "type": "Feature", "properties": { "name": "Lxombur", }, "geometry": { "type": "Point", "coordinates": [6.1890624, 49.605019] } },
  { "type": "Feature", "properties": { "name": "Luchsembursch", }, "geometry": { "type": "Point", "coordinates": [6.140012, 49.61908] } },
  { "type": "Feature", "properties": { "name": "Laxsembrg", }, "geometry": { "type": "Point", "coordinates": [6.066418, 49.620134] } }
];

var overlays = {
  'Background (base layer)': new L.TileLayer(backgroundTileUrl, {pane: 'tilePane', minZoom: 3, maxZoom: 18, noWrap: true}).addTo(map),
  'Municipalities (custom data)': new L.GeoJSON(municipalities, { pane: 'tilePane', style: municipalityStyle, attribution: '2012 GfK Geomarketing GmbH' }).addTo(map),
  'Transport (base layer)': new L.TileLayer(transportTileUrl, {pane: 'overlayPane', minZoom: 3, maxZoom: 18, noWrap: true}).addTo(map),
  'Route (custom data)': new L.GeoJSON(routePolyline, { pane: 'overlayPane', style: { color: "#575757", weight: 7 } }).addTo(map),
  'POIs (custom data)': new L.GeoJSON(pois).addTo(map),
  'Labels (base layer)': new L.TileLayer(labelsTileUrl, {pane: 'popupPane', minZoom: 3, maxZoom: 18, noWrap: true}).addTo(map),
};

// add layers to control.layers to show the collection of available layers
L.control.layers(null, overlays, { collapsed: false }).addTo(map);